// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
contract Junqi {
  uint64 constant g = 69;
  uint64 constant p = 999983;

  uint64 last_id = 1;
  uint64 n_games = 0;
  uint64 n_activegames = 0;

  struct Game{
      address p1;
      address p2;
      uint64 board1;
      uint64 board2;
      uint turn; // 1 for p1, 2 for p2
      bool active; // two player ready
      uint64 winner;
      bool exists; // ?
      uint64 lastMoves; // ?
  }

  event GameIDs(address indexed from, uint gameID);

  mapping(uint => Game) public games;

  function declare() external {
    // pseudorandom gameID
    uint64 gameID = (last_id * g) % p;
    while (games[gameID].exists) {
      gameID = (gameID + 1) % p;
    }
    last_id = gameID;

    Game storage game = games[gameID];

    game.p1 = msg.sender;
    game.board1 = 0;
    game.turn = 1;
    game.active = false;

    n_games++;

    emit GameIDs(msg.sender, gameID);
  }
  function join(uint gameID) external {
    Game storage game = games[gameID];
    require(game.exists && !game.active);
    require(game.p1 != msg.sender);
    game.p2 = msg.sender;
    game.board2 = 0;

    game.active = true;
    n_activegames++;
  }
  function place () external {

  }
  function move () external {

  }
  function checkGameEnd() internal{

  }
}
